ivos.','Start Page'=>'Página de inicio','End Page'=>'Página final','In millimeters. Yes, metric! Defaults to 0'=>'En milímetros. Sí, ¡métrico! Por defecto 0','Watermark Text'=>'Texto de marca de agua','Shortcodes available, all caps, in brackets:'=>'Shortcodes disponibles, todas las tapas, entre corchetes:','<a href="%s" target="_blank" rel="noopener">Upgrade</a> to use HTML and for more than one watermark placement, anywhere, on any page(s).'=>'<a href="%s" target="_blank" rel="noopener">Actualización</a> para utilizar HTML y para colocar más de una marca de agua, en cualquier lugar, en cualquier página(s).','Font Face'=>'Tipo de Fuente','Select a font for watermarks. M Sung will have limited Chinese characters, and Furat will have limited Arabic characters'=>'Seleccione una fuente para marcas de agua. M Sung tendrá caracteres chinos limitados, y Furat tendrá caracteres árabes limitados','Font Size'=>'Tamaño de Fuente','Provide a number (suggested 10-40) for the font size'=>'Indique un número (sugerido 10-40) para el tamaño de letra','Watermark Color'=>'Marca de agua Color','Color of the watermark, in hex. Defaults to black <code>#000000</code>'=>'Color de la marca de agua, en hexadecimal. Por defecto es negro <code>#000000</code>','Opacity'=>'Opacidad','Rotation'=>'Rotación','Y Fine Tuning'=>'sintonía fina','Move the content up and down on the page by adjusting this number. In millimeters. If this number is longer/higher than the length/height of your PDF, it will default back to -10 (10 millimeters from the bottom of the page). Account for the height of your font/text!'=>'Mueva el contenido hacia arriba y hacia abajo en la página ajustando este número. En milímetros. Si este número es más largo/superior que la longitud/altura de su PDF, volverá por defecto a -10 (10 milímetros desde el fondo de la página). Tenga en cuenta la altura de su fuente/texto!','Serve PDF if not stamped?'=>'¿Servir PDF si no tiene marcas de agua?','Encryption Level'=>'Nivel de cifrado','Disable Printing'=>'Desactivar la impresión','Check this box to make it much more difficult for your PDF to be printed by the end consumer.'=>'Marque esta casilla para dificultar la impresión de su PDF por parte del consumidor final.','Disable'=>'Deshabilitar','Disable Copying'=>'Desactivar copia','Check this box to prevent your end consumer from copying and pasting content from your PDF.'=>'Marque esta casilla para evitar que el consumidor final de copiar y pegar el contenido de tu PDF.','Disable Editing'=>'Para deshabilitar la edición','Check this box to prevent editing of your PDF by the end consumer in Acrobat.'=>'Marque esta casilla para evitar la edición de su PDF por el consumidor final en Acrobat.','Disable Annotations'=>'Desactivar las anotaciones','Check this box to prevent the addition of annotations and forms to the file.'=>'Marque esta casilla para impedir que se añadan anotaciones y formularios al fichero.','Disable Form Filling'=>'Desactivar el llenado de formularios','Disable Extraction'=>'Desactivar extracción','Disable Assembly'=>'Deshabilitar ensamblaje','Disable High Res Printing'=>'Desactivar la impresión en alta resolución','PDF User Password'=>'Contraseña de usuario de PDF','This is a password your end user will need to enter before viewing the PDF file.'=>'Se trata de una contraseña que el usuario final deberá introducir antes de ver el archivo PDF.','PDF Owner Password'=>'Contraseña de propietario de PDF','An owner password allows the end user to take control of a PDF. Leave blank and it will be set by MD5 hash automatically (it will be different for every download, and you will not know it).'=>'Una contraseña de propietario permite al usuario final tomar el control de un PDF. Déjela en blanco y se establecerá por hash MD5 automáticamente (será diferente para cada descarga, y usted no lo sabrá).','Unlock with User Password?'=>'¿Desbloquear con contraseña de usuario?','By default PDF protections can only be removed with an owner password. Check to allow removal with a user password. USE WITH CAUTION.'=>'Por defecto, las protecciones de PDF sólo pueden eliminarse con una contraseña de propietario. Marque para permitir la eliminación con una contraseña de usuario. UTILIZAR CON PRECAUCIÓN.','Housekeeping'=>'Limpieza','Leave No Trace?'=>'¿No dejas rastro?','If this box is checked and you uninstall PDF Ink Lite, all your settings will be deleted from your WordPress database.'=>'Si esta casilla está marcada y desinstala PDF Ink Lite, todos sus ajustes se eliminarán de la base de datos de WordPress.','Marked PDF files will accumulate in your PDF folder whether using Force downloads or not. To keep your server tidy, manually delete ad lib or </strong><a href="%s" target="_blank" rel="noopener">upgrade this plugin</a></strong> for better file handling and automatic cleaning.'=>'Los archivos PDF marcados se acumularán en su carpeta PDF tanto si utiliza Descargas forzadas como si no. Para mantener su servidor ordenado, elimine manualmente ad lib o </strong><a href="%s" target="_blank" rel="noopener">actualizar este plugin</a></strong> para un mejor manejo de archivos y limpieza automática.','Give Us Attribution'=>'Atribución','We\'d love it if you check this box and allow us to add a tiny, invisible link to the second page of your marked PDF files, giving PDF Ink Lite credit.'=>'Nos encantaría que marcara esta casilla y nos permitiera añadir un pequeño enlace invisible a la segunda página de sus archivos PDF marcados, dando crédito a PDF Ink Lite.','Enable Logs?'=>'¿Habilitar registros?','Check to enable event/error logging. This can help with debugging.'=>'Active el registro de eventos/errores. Esto puede ayudar con la depuración.','More Info'=>'Más Info','PDF Ink Lite is rudimentary and may not work on every PDF. Test before going live, and remember, it\'s free!'=>'PDF Ink Lite es rudimentario y puede que no funcione con todos los PDF. Pruébelo antes de utilizarlo y recuerde que es gratis!','The only watermarking plugin for Download Monitor that works with <strong>any and every</strong> PDF is <a href="%s" target="_blank" rel="noopener">PDF Ink combined with the SetaPDF-Stamper add-on</a>.'=>'El único complemento de marca de agua para Download Monitor que funciona con <strong>todos y cada uno de los</strong> PDF es <a href="%s" target="_blank" rel="noopener">PDF Ink combinado con el complemento SetaPDF-Stamper</a>.','Greyed-out settings below are included in the <a href="%s" target="_blank" rel="noopener">full (paid) PDF Ink version</a>, which provides <a href="%s">many more features</a>.'=>'Los ajustes que aparecen en gris a continuación están incluidos en la <a href="%s" target="_blank" rel="noopener">versión completa (de pago) de PDF Ink</a>, que <a href="%s">ofrece muchas más funciones</a>.','Stamp every page, the first page only, the last page only, every odd page, every even page, or custom page range. Defaults to `Every page`'=>'Estampar todas las páginas, sólo la primera página, sólo la última página, todas las páginas impares, todas las páginas pares o un intervalo de páginas personalizado. Por defecto es "Todas las páginas"','Provide a number to indicate the page you wish watermarking to begin on. Defaults to page 1.'=>'Proporcionar un número para indicar que la página que desea watermarking para comenzar. Por defecto la Página 1.','Provide a number to indicate the page you wish watermarking to end on. Type \'last\' to indicate last page. Defaults to last page'=>'Introduzca un número para indicar la página en la que desea que termine la marca de agua. Escriba "última" para indicar la última página. Por defecto es la última página','Make your stamp transparent. A value of 0 will be translucent, .5 means 50% opaque, .75 is 3/4 opaque, etc.'=>'Haz que tu sello sea transparente. Un valor de 0 será translúcido, .5 significa 50% opaque, .75 es 3/4 opaco, etc.','Rotate the stamp on the page 0-359 degrees'=>'Girar el sello en la página 0-359 grados','Should the un-watermarked PDF still be served if watermarking or encryption fails? Default no.'=>'¿Debe seguir sirviéndose el PDF sin marca de agua si falla la marca de agua o el cifrado? Por defecto no.','RC4 encryption is automatically set because it is required for protections & passwording.'=>'El cifrado RC4 se establece automáticamente porque es necesario para las protecciones y las contraseñas.','If your server doesn’t support RC4 encryption, watermarking will fail.'=>'Si su servidor no admite el cifrado RC4, la marca de agua fallará.','Encryption can slow down and possibly stall your downloads, especially if you are watermarking files with images or embedded fonts.'=>'La encriptación puede ralentizar y posiblemente paralizar tus descargas, especialmente si estás poniendo marcas de agua a archivos con imágenes o fuentes incrustadas.','The RC4 stream cipher is not bullet-proof.'=>'El cifrado de flujo RC4 no es a prueba de balas.','Some browsers or PDF viewers may ignore protection settings, and some diligent customers might find ways to remove watermarks and passwords.'=>'Algunos navegadores o visualizadores de PDF pueden ignorar la configuración de protección, y algunos clientes diligentes pueden encontrar formas de eliminar marcas de agua y contraseñas.','Check this box to disable filling in existing interactive form fields (including signature fields).'=>'Marque esta casilla para desactivar la cumplimentación de los campos de formularios interactivos existentes (incluidos los campos de firma).','Check this box to disallow extraction of text and graphics (extraction supports of accessibility to users with disabilities and other purposes).'=>'Marque esta casilla para no permitir la extracción de texto y gráficos (la extracción favorece la accesibilidad para usuarios con discapacidades y otros fines).','Check this box to disable assembly (insertion, rotation, or deletion of pages and creation of bookmarks or thumbnail images).'=>'Marque esta casilla para desactivar el montaje (inserción, rotación o eliminación de páginas y creación de marcadores o imágenes en miniatura).','Check this box to make it more difficult for your PDF to be printed beautifully by the end consumer.'=>'Marque esta casilla para dificultar la impresión de su PDF por parte del consumidor final.','The only watermarking plugin for Easy Digital Downloads that works with <strong>any and every</strong> PDF is <a href="%s" target="_blank" rel="noopener">PDF Ink combined with the SetaPDF-Stamper add-on</a>.'=>'El único complemento de marca de agua para Easy Digital Downloads que funciona con <strong>todos y cada uno de los</strong> PDF es <a href="%s" target="_blank" rel="noopener">PDF Ink combinado con el complemento SetaPDF-Stamper</a>.','PDF Ink Lite Settings'=>'PDF Ink Lite Opciones','Enable Watermarking'=>'Activar marca de agua','Check to watermark PDFs sold via Easy Digital Downloads using the settings below.'=>'Compruebe la marca de agua en los PDF vendidos a través de Easy Digital Downloads utilizando la configuración que se indica a continuación.','List file name(s) of PDF(s), one per line, e.g.,'=>'Enumere los nombres de archivo de los PDF, uno por línea, p. ej,','or'=>'o','Case-sensitive.'=>'Se distingue entre mayúsculas y minúsculas.','If left blank and the Global checkbox above is checked, <strong>all</strong> PDFs sold through EDD will be watermarked.'=>'Si se deja en blanco y se marca la casilla Global, <strong>todos los</strong> PDF vendidos a través de EDD llevarán marca de agua.','Right to Left Watermarking'=>'De derecha a izquierda de marca de agua','Check to switch from default left-to-right (LTR) to right-to-left (RTL), for Arabic, Hebrew, etc.'=>'De verificación para cambiar de forma predeterminada de izquierda a derecha (LTR) de derecha a izquierda (RTL), para árabe, hebreo, etc.','Pages to watermark'=>'Páginas de marca de agua','Watermark every page, the first page only, the last page only, every odd page, every even page, or custom page range. Defaults to `Every page`'=>'Marca de agua en todas las páginas, sólo en la primera página, sólo en la última página, en todas las páginas impares, en todas las páginas pares o en un intervalo de páginas personalizado. Por defecto es "Todas las páginas"','Top/bottom margin'=>'Margen superior/inferior','Left/right margin'=>'Margen izquierda/derecha','Page Setup'=>'Configurar página','Rotate the watermark on the page 0-359 degrees. Rotation is counter-clockwise.'=>'Rota la marca de agua en la página 0-359 grados. La rotación se realiza en el sentido contrario a las agujas del reloj.','X Fine Tuning'=>'X Fine Tuning','Move the watermark left and right by adjusting this number. In millimeters. Default 0'=>'Mueva la marca de agua a izquierda y derecha ajustando este número. En milímetros. Por defecto 0','Security Settings'=>'Configuraciones de seguridad','Serve PDF if not watermarked?'=>'¿Servir PDF si no tiene marcas de agua?','If no, the customer will receive an error message saying if file preparation has failed.'=>'En caso negativo, el cliente recibirá un mensaje de error indicando que la preparación del archivo ha fallado.','Encryption level'=>'Nivel de cifrado','Check this box to make it more difficult for your PDF to be printed by the end consumer.'=>'Marque esta casilla para dificultar la impresión de su PDF por parte del consumidor final.','Check this box to prevent editing/modification of your PDF by the end consumer in Acrobat.'=>'Marque esta casilla para evitar que el consumidor final de Acrobat edite/modifique su PDF.','Check this box to prevent the addition or modification of text annotations/comments, and filling of interactive form fields. If "editing and annotation" are both allowed, customers can create or modify interactive form fields (including signature fields).'=>'Marque esta casilla para impedir que se añadan o modifiquen anotaciones/comentarios de texto y que se rellenen los campos de formularios interactivos. Si se permite tanto la "edición como la anotación", los clientes pueden crear o modificar campos de formulario interactivos (incluidos los campos de firma).','Check this box to prevent insertion, rotation, or deletion of pages and creation of bookmarks or thumbnail images.'=>'Marque esta casilla para evitar la inserción, rotación o eliminación de páginas y la creación de marcadores o imágenes en miniatura.','Check this box to prevent filling in existing interactive form fields (including signature fields).'=>'Marque esta casilla para impedir que se rellenen los campos de formularios interactivos existentes (incluidos los campos de firma).','Disable Accessibility'=>'Desactivar la accesibilidad','Check this box to prevent extraction of text and graphics (in support of accessibility to users with disabilities or for other purposes). Some PDF readers already disable this.'=>'Marque esta casilla para impedir la extracción de texto y gráficos (para favorecer la accesibilidad de los usuarios con discapacidades o para otros fines). Algunos lectores de PDF ya lo desactivan.','User Password (optional)'=>'Contraseña de usuario (opcional)','Enter <code>email</code> to set the password automagically as the user\'s checkout email address.'=>'Introduzca <code>el correo electrónico</code> para establecer la contraseña automáticamente como la dirección de correo electrónico de pago del usuario.','Owner Password (optional)'=>'Contraseña del propietario (opcional)','Easy Digital Downloads debug logs can be found at Downloads > Tools > Debug Log'=>'Los registros de depuración de Easy Digital Downloads se encuentran en Descargas > Herramientas > Registro de depuración','Leave No Trace'=>'No dejar rastro','If this box is checked and you uninstall PDF Ink Lite, all your settings will be deleted from your Wordpress database.'=>'Si esta casilla está marcada, si/cuando desinstale PDF Ink Lite, todos sus ajustes se borrarán de su base de datos de Wordpress.','New with PDF Ink Lite v4: marked PDF files are stored in the wp-content/uploads/pdf-ink/ folder for easier management.'=>'Novedad de PDF Ink Lite v4: los archivos PDF marcados se almacenan en la carpeta wp-content/uploads/pdf-ink/ para facilitar su gestión.','Check to watermark PDFs sold via WooCommerce using the settings below.'=>'Compruebe la marca de agua de los PDF vendidos a través de WooCommerce utilizando la configuración de abajo.','File(s) to watermark'=>'Archivo (s) a la marca de agua',' Case-sensitive.'=>' Se distingue entre mayúsculas y minúsculas.','Enable New Logic?'=>'¿Habilitar una nueva lógica?','If this box is checked, it changes how the `File(s) to Watermark` field above works.'=>'Si esta casilla está marcada, cambia el funcionamiento del campo `File(s) to Watermark` anterior.','If checked, and "Enable Watermarking" is also checked, any files listed in the box will not be watermarked.'=>'Si la casilla está marcada y también lo está "Activar marca de agua", los archivos que aparezcan en ella no llevarán marca de agua.','If checked, and "Enable Watermarking" is not checked, any files listed in the box will be watermarked.'=>'Si la casilla está marcada y la opción "Activar marca de agua" no lo está, todos los archivos que aparezcan en ella llevarán una marca de agua.','Licensed to [FIRSTNAME] [LASTNAME], [EMAIL]'=>'Licenciado en [FIRSTNAME] [LASTNAME], [EMAIL]','The only watermarking plugin for WooCommerce that works with <strong>any and every</strong> PDF is <a href="%s" target="_blank" rel="noopener">PDF Ink combined with the SetaPDF-Stamper add-on</a>.'=>'El único plugin de marca de agua para WooCommerce que funciona con <strong>todos y cada uno de los</strong> PDF es <a href="%s" target="_blank" rel="noopener">PDF Ink combinado con el complemento SetaPDF-Stamper</a>.','Greyed-out settings below are included in the full (paid) plugin version. <a href="%s" target="_blank" rel="noopener">PDF Ink (the upgrade for this plugin)</a> will provide you with <a href="%s">many more features</a>.'=>'Los ajustes que aparecen en gris a continuación están incluidos en la versión completa (de pago) del plugin. <a href="%s" target="_blank" rel="noopener">PDF Ink (la actualización de este plugin)</a> le proporcionará <a href="%s">muchas más funciones</a>.','FAQ'=>'FAQ','Support'=>'Asistencia','Upgrade your plugin'=>'Actualice su plugin','Upgrade this plugin'=>'Actualizar este plugin','Go to the settings page'=>'Ir a la página de configuración','Settings for Woo'=>'Ajustes para Woo','Settings for EDD'=>'Ajustes para EDD','Settings for DLM'=>'Ajustes para DLM','About the Plugin'=>'Acerca del plugin','About PDF Ink Lite'=>'Sobre PDF Ink Lite','Protect your intellectual property! PDF Ink Lite allows WooCommerce site administrators to apply custom watermarks to PDFs upon sale.'=>'Proteger su propiedad intelectual. PDF Ink Lite permite a los administradores de sitio WooCommerce aplicar marcas de agua personalizados a PDF en venta.','PDF Ink Lite is a plugin that can add a watermark to every page of your PDF file(s). The watermark is customizable with font face, font color, font size, placement, and text. Not only that, but since the watermark is added when the download button is clicked (either on the customer\'s order confirmation page or email), the watermark can include customer-specifc data such as the customer\'s first name, last name, and email. Your watermark is highly customizable and manipulatable.'=>'PDF Ink Lite es un plugin que puede añadir una marca de agua a cada página de su(s) archivo(s) PDF. La marca de agua se puede personalizar con la fuente, el color, el tamaño, la ubicación y el texto. No sólo eso, sino que como la marca de agua se añade al hacer clic en el botón de descarga (ya sea en la página de confirmación del pedido del cliente o en el correo electrónico), la marca de agua puede incluir datos específicos del cliente, como su nombre, apellidos y correo electrónico. Su marca de agua es altamente personalizable y manipulable.','<a href="%s" target="_blank" rel="noopener">Consider upgrading to PDF Ink</a> if you need more functionality.'=>'<a href="%s" target="_blank" rel="noopener">Considere la posibilidad de actualizar a PDF Ink</a> si necesita más funciones.','For more information:'=>'Para más información:','Frequently Asked Questions'=>'Preguntas Frecuentes','Plugin at WordPress.org'=>'Plugin en WordPress.org','Upgrade'=>'Mejorar','Cloning is forbidden.'=>'La clonación está prohibida.','Unserializing instances of this class is forbidden.'=>'Se prohíbe la serialización de instancias de esta clase.','<strong>PDF Ink Lite</strong> supports PHP %s or later. Please update PHP on your server for better overall results.'=>'<strong>PDF Ink Lite para WooCommerce</strong> soporta PHP %s o posterior. Por favor, actualice PHP en su servidor para obtener mejores resultados generales.','<strong>PDF Ink Lite</strong> supports WordPress version %s or later. Please update WordPress to use this plugin.'=>'<strong>PDF Ink Lite</strong> es compatible con la versión de WordPress %s o posterior. Por favor, actualice WordPress para usar este plugin.','The <strong>PDF Ink Lite</strong> plugin requires WooCommerce be activated. You can <a href="%s" target="_blank" rel="noopener">download WooCommerce here</a>.'=>'El plugin <strong>PDF Ink Lite</strong> requiere que WooCommerce esté activado. Puede <a href="%s" target="_blank" rel="noopener">descargar WooCommerce aquí</a>.','Sorry, <strong>PDF Ink Lite</strong> supports WooCommerce version %s or newer, for security reasons.'=>'Lo sentimos, <strong>PDF Ink Lite</strong> es compatible con WooCommerce versión %s o posterior, por razones de seguridad.','PDF Ink Lite requires that the directory defined by <code>PDFINK_LITE_UPLOADS_PATH</code> (usually `<strong>wp-content/uploads/pdf-ink/</strong>`) is writable.'=>'PDF Ink Lite requiere que el directorio definido por <code>PDFINK_LITE_UPLOADS_PATH</code> (normalmente <strong>`wp-content/uploads/pdf-ink/`</strong>) tenga permisos de escritura.','Watermarking events and errors will be saved to a file in your /wp-content/ folder. You can view the contents below.'=>'Los eventos de marca de agua y los errores se guardarán en un archivo en su carpeta /wp-content/. Puede ver el contenido a continuación.','Maybe only turn this on for troubleshooting because this file can get large.'=>'Tal vez sólo activar esto para la solución de problemas debido a que este archivo puede llegar a ser grande.','Use this tool to help debug TCPDI/TCPDF and PDF Ink functionality.'=>'Utilice esta herramienta para ayudar a depurar la funcionalidad de TCPDI/TCPDF y PDF Ink.','Download Debug Log File'=>'Descarga el archivo de registro de depuración','Clear Log'=>'Limpiar el registro','Copy Entire Log'=>'Copiar registro completo','Log file'=>'Archivo','Hi, I\'m Caroline.'=>'Hola, me llamo Caroline.','I\'ve kept the <strong>PDF Ink Lite</strong> plugin in active development since 2014 as an unpaid volunteer.'=>'He mantenido el plugin <strong>PDF Ink</strong> Lite en desarrollo activo desde 2014 como voluntario no remunerado.','If you enjoy the free version, think about <a href="%s" target="_blank" rel="noopener">upgrading to the full version</a> for even more great features!'=>'Si te gusta la versión gratuita, piensa en <a href="%s" target="_blank" rel="noopener">actualizar a la versión completa</a> para disfrutar de más funciones!','Upgrade Features:'=>'Características de mejora:','Priority email support, <a href="%s" target="_blank" rel="noopener">and more!</a>'=>'Asistencia prioritaria por correo electrónico, <a href="%s" target="_blank" rel="noopener">¡y mucho más!</a>','Can\'t Upgrade? Support My Work Another Way!'=>'¿No puede actualizar? ¡Apoya mi trabajo de otra manera!','If PDF Ink is not in your budget, please take a moment to write <a href="%s" target="_blank" rel="noopener">an encouraging review</a>, or <a href="%s" target="_blank" rel="noopener noreferrer">donate a couple dollars using PayPal</a> to cover my coffee today.'=>'Si PDF Ink no está en su presupuesto